private boolean checkIfFinalAndReplace(DfaState state,LookAheadDfa dnet,Map<Integer,DfaState> finalsBack,boolean backup){
  Set<Integer> predictingAlts=state.getAllPredictingAlts();
  if (predictingAlts.size() == 1) {
